import React, { useMemo } from 'react';
import axios from 'axios';
import {COLUMNS} from './columns';
import './table.css';
import {useTable} from 'react-table';

export const CryptoList = () =>{
  async function getData(){
    return await axios.get('http://localhost:5000/crypto/');
  }
  let test2 = getData().then((response) => {
    return response.data;
  })
  .catch((error)=>{
    console.log(error);
  })
  const abc = test2.then(function(result){
    console.log(result);
    return result;
  })

  Promise.all(test2).then(console.log);

  console.log(test2);
  console.log(abc);
  const Cryptodata = test2;
  //const listItems = Cryptodata.map((d) => <li key={d.name}>{d.name}</li>);
  //const result = Object.assign({}, Cryptodata);
  //console.log(result);
  //console.log(Array.isArray(Cryptodata));
  const columns = useMemo(()=> COLUMNS, []);
  const data = useMemo(()=> Cryptodata, []);
  const {
      getTableProps, 
      getTableBodyProps, 
      headerGroups, 
      rows, 
      prepareRow
  } = useTable({
    columns, 
    data:data
  });

  return(
    <table {...getTableProps}>
            <thead>
                {headerGroups.map((headerGroup)=>(
                    <tr {...headerGroup.getHeaderGroupProps()}>
                        {headerGroup.headers.map((column)=>(
                            <th {...column.getHeaderProps()}>
                                {column.render('Header')}
                            </th>
                    ))} 
                    </tr>
                ))}
                
            </thead>
            <tbody {...getTableBodyProps}>
                {rows.map((row) =>{
                    prepareRow(row)
                    return(
                        <tr {...row.getRowProps()}>
                            {row.cells.map((cell)=>{
                                return <td {...cell.getCellProps()}>
                                    {cell.render('Cell')}
                                </td>
                            })}
                        </tr>
                    )
                })} 
            </tbody>
        </table>

  )
}

  
export default CryptoList;
